import styles from "./CentralSection.module.css";
import FullWidthSection from "./FullWidthSection";

const CentralSection = (props) => {
  return (
    <FullWidthSection>
      <div className={styles.centralSection}>{props.children}</div>
    </FullWidthSection>
  );
};

export default CentralSection;
